import React from 'react';
import Mtitle from './MainTitle';
import Navbar from './NavBar';
import Gallery from './Gallery';
import './Style.css';



function App() {
  return (
    <div className="app-container">
      <link rel='icon' href='favicon.png' type='image/png' sizes='16x16'></link>
      <header>
        <Mtitle/>{}
        <Navbar/>{}
        <Gallery/>{}
      </header>
    </div>
  );
}

export default App;
